import io from 'socket.io-client';

export class GameScene extends Phaser.Scene {
    constructor() {
        super({
            key: 'Game'
        });
        this.socket = io();
        this.currentPlayers = this.currentPlayers.bind(this);
        this.addPlayer = this.addPlayer.bind(this);
        this.addOtherPlayers = this.addOtherPlayers.bind(this);
        this.playerMoved = this.playerMoved.bind(this);
        this.disconnected = this.disconnected.bind(this);
        this.scoreUpdate = this.scoreUpdate.bind(this);
        this.starLocation = this.starLocation.bind(this);
    }
    preload() {
        this.load.image('person', 'img/character.jpg');
        this.load.image('otherPlayer', 'img/character.jpg');
        this.load.image('star', 'img/star-icon.png');
        this.load.image('tiles', 'sprites/desert.png');
        this.load.tilemapTiledJSON('map', 'maps/desert.json');
    }
    create() {
        const { socket } = this;

        // create map
        this.map = this.make.tilemap({ key: 'map' });
        const tiles = this.map.addTilesetImage('Desert', 'tiles');
        this.groundLayer = this.map.createDynamicLayer('Ground', tiles, 0, 0);
        this.collidingLayer = this.map.createDynamicLayer('Colliding', tiles, 0, 0);
        this.collidingLayer.setCollisionByProperty({ collides: true });
        // const newMap = this.map.setCollisionByExclusion([-1]);
        const debugGraphics = this.add.graphics().setAlpha(0.75);
        this.collidingLayer.renderDebug(debugGraphics, {
          tileColor: null,
          collidingTileColor: new Phaser.Display.Color(243, 134, 48, 255),
          faceColor: new Phaser.Display.Color(40, 39, 37, 255)
        });

        

        this.velocity = 600;
        this.otherPlayers = this.physics.add.group();
        this.cursors = this.input.keyboard.createCursorKeys();
        this.blueScoreText = this.add.text(16, 16, '', { fontSize: '32px', fill: '#0000FF' });
        this.redScoreText = this.add.text(584, 16, '', { fontSize: '32px', fill: '#FF0000' });

        const controlConfig = {
          camera: this.cameras.main,
          left: this.cursors.left,
          right: this.cursors.right,
          up: this.cursors.up,
          down: this.cursors.down,
          speed: 0.5
        };
        this.controls = new Phaser.Cameras.Controls.FixedKeyControl(controlConfig);

        this.keys = {
          up: this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.UP),
          x: this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.X),
          left: this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.LEFT),
          right: this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.RIGHT),
          down: this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.DOWN),
        };

        this.marker = this.add.graphics();
        this.marker.lineStyle(5, 0xffffff, 1);
        this.marker.strokeRect(0, 0, this.map.tileWidth, this.map.tileHeight);
        this.marker.lineStyle(3, 0xff4f78, 1);
        this.marker.strokeRect(0, 0, this.map.tileWidth, this.map.tileHeight);

        socket.on('currentPlayers', this.currentPlayers);
        socket.on('newPlayer', this.addOtherPlayers);
        socket.on('playerMoved', this.playerMoved);
        socket.on('disconnect', this.disconnected);
        socket.on('scoreUpdate', this.scoreUpdate);
        socket.on('starLocation', this.starLocation);
    }

    update(time, delta) {

      if (this.marker) {
        const worldPoint = this.input.activePointer.positionToCamera(this.cameras.main);
        const pointerTileXY = this.groundLayer.worldToTileXY(worldPoint.x, worldPoint.y);
        const snappedWorldPoint = this.groundLayer.tileToWorldXY(pointerTileXY.x, pointerTileXY.y);
        this.marker.setPosition(snappedWorldPoint.x, snappedWorldPoint.y);
        
        if (this.input.activePointer.isDown) {
          console.log('place something here');
          // const tile = groundLayer.putTileAtWorldXY(6, worldPoint.x, worldPoint.y);
          // tile.setCollision(true);
        }
      }

      if (this.player) {
        let animDir = "";
        let madeAMove = false;
        this.controls.update(delta);
        if (this.keys.up.isDown) {
          this.player.setVelocityY(-600);
          madeAMove = true;
          animDir = "up";
        } else if (this.keys.right.isDown) {
          this.player.body.setVelocity(this.velocity, 0);
          madeAMove = true;
          animDir = "right";
        } else if (this.keys.down.isDown) {
          this.player.body.setVelocity(0, this.velocity);
          madeAMove = true;
          animDir = "down";
        } else if (this.keys.left.isDown) {
          this.player.body.setVelocity(-this.velocity, 0);
          madeAMove = true;
          animDir = "left";
        } else {
          this.player.body.setVelocity(0, 0);
        }
          
          // this.physics.world.wrap(this.player, 5);
      
          // emit player movement
          var x = this.player.x;
          var y = this.player.y;
          var r = this.player.rotation;
          if (this.player.oldPosition && (x !== this.player.oldPosition.x || y !== this.player.oldPosition.y || r !== this.player.oldPosition.rotation)) {
              this.socket.emit('playerMovement', { x: this.player.x, y: this.player.y, rotation: this.player.rotation });
          }
          
          // save old position data
          this.player.oldPosition = {
              x: this.player.x,
              y: this.player.y,
              rotation: this.player.rotation
          };
      }
        
    }

    debug() {
        this.debugGraphics.clear();
        var color = 0xffff00;
        var thickness = 2;
        var alpha = 1;

        this.debugGraphics.lineStyle(thickness, color, alpha);

        this.debugGraphics.strokeRect(player.body.gridPosition.x * 8, player.body.gridPosition.y * 8, 16, 16);
        //console.log(layer.getTileAt(player.body.gridPosition.x * 8,player.body.gridPosition.x * 8));

    }

    starLocation(starLocation) {
      const { socket } = this;

      if (this.star) this.star.destroy();
        this.star = this.physics.add.image(starLocation.x, starLocation.y, 'star');
        this.physics.add.overlap(this.player, this.star, function () {
          socket.emit('starCollected');
        }, null, this);
    }

    scoreUpdate(scores) {
      this.blueScoreText.setText('Blue: ' + scores.blue);
      this.redScoreText.setText('Red: ' + scores.red);
    }

    disconnected(playerId) {
      this.otherPlayers.getChildren().forEach(function (otherPlayer) {
        if (playerId === otherPlayer.playerId) {
          otherPlayer.destroy();
        }
      });
    }

    playerMoved(playerInfo) {
        this.otherPlayers.getChildren().forEach(function (otherPlayer) {
            if (playerInfo.playerId === otherPlayer.playerId) {
                otherPlayer.setPosition(playerInfo.x, playerInfo.y);
            }
        });
    }

    currentPlayers(players) {
        const { socket, addPlayer, addOtherPlayers } = this;
        Object.keys(players).forEach(function (id) {
            if (players[id].playerId === socket.id) {
                addPlayer(players[id]);
            } else {
                addOtherPlayers(players[id]);
            }
        });
    }

    addPlayer(playerInfo) {
        this.player = this.physics.add
          .sprite(playerInfo.x, playerInfo.y, 'person')
          .setMaxVelocity(300, 400)
          .setOrigin(0.5, 0.5)
          .setDisplaySize(53, 40);
        if (playerInfo.team === 'blue') {
          this.player.setTint(0x0000ff);
        } else {
          this.player.setTint(0xff0000);
        }
        this.player.setDrag(100);
        this.player.setAngularDrag(100);
        this.player.setMaxVelocity(200);
        
        this.physics.add.collider(this.player, this.collidingLayer);

        // add map bounds and camera controls
        this.cameras.main.startFollow(this.player);
        this.cameras.main.setBounds(0, 0, this.map.widthInPixels, this.map.heightInPixels);
      }
    
      addOtherPlayers(playerInfo) {
        const otherPlayer = this.add
          .sprite(playerInfo.x, playerInfo.y, 'otherPlayer')
          .setOrigin(0.5, 0.5)
          .setDisplaySize(53, 40);
        if (playerInfo.team === 'blue') {
          otherPlayer.setTint(0x0000ff);
        } else {
          otherPlayer.setTint(0xff0000);
        }
        otherPlayer.playerId = playerInfo.playerId;
        this.otherPlayers.add(otherPlayer);
      }
}
